import TodoList from "./TodoList";
import React, { useState } from "react";


function App() {
  const [todos, setTodos] = useState([]);
  return (
    <>
      <TodoList todos={todos}/>
      <input type='text' />
      <button>Add</button>
      <button>Clear</button>
      <div>0 Left To Do</div>
    </>

    );
}

export default App;
